import React from "react";
import "./button-radio.css";


function ButtonRadioRegister({title, role, register,name}) {
    return (
        <>
            <label htmlFor={title}>
                <input type="radio"
                       name={role}
                       id={title}
                       value={role}
                       {...register(name)}/>
                <div className="box">
                    <span>{title}</span>
                </div>
            </label>

        </>
    )
}

export default ButtonRadioRegister;
